/**
 * NODE 1 â€” Clean + Normalize (GENÃ‰RICO) + Phone type + WhatsApp likely (ES)
 * openingHours eliminado
 * n8n Code node
 * Mode: Run Once for All Items
 * Language: JavaScript
 */

function toStr(v) {
  return (v ?? "").toString().trim();
}

function uniq(arr) {
  return Array.from(new Set((arr || []).filter(Boolean)));
}

function normEmail(e) {
  return toStr(e).toLowerCase();
}

function extractDomainFromUrl(url) {
  try {
    const u = new URL(url);
    return u.hostname.replace(/^www\./, "").toLowerCase();
  } catch {
    return "";
  }
}

function normalizePhone(raw) {
  const s = toStr(raw);
  if (!s) return "";
  const cleaned = s.replace(/[^\d+]/g, "");
  if (!cleaned) return "";
  if (cleaned.startsWith("+")) return cleaned;

  const digits = cleaned.replace(/[^\d]/g, "");
  // ES convenience normalization when local 9 digits
  if (digits.length === 9) return `+34${digits}`;
  if (digits.length === 11 && digits.startsWith("34")) return `+${digits}`;
  return digits ? `+${digits}` : "";
}

function pickPrimaryEmail(emails, domain) {
  const normalized = uniq((emails || []).map(normEmail));

  const match = normalized.find((e) => domain && e.endsWith(`@${domain}`));
  if (match) return match;

  return normalized[0] || "";
}

function pickPrimaryPhone(phone, phones) {
  const candidates = uniq([
    normalizePhone(phone),
    ...(phones || []).map(normalizePhone),
  ]).filter(Boolean);

  return candidates[0] || "";
}

function detectEcommerce(scrapedUrls) {
  const urls = (scrapedUrls || []).map((u) => toStr(u).toLowerCase());
  const re = /\/(shop|tienda|store|carrito|checkout|producto|productos)\b/;

  const matched = urls.filter((u) => re.test(u));
  return {
    is_ecommerce: matched.length > 0,
    matched_urls: matched,
  };
}

function phoneTypeES(e164) {
  const p = toStr(e164).replace(/[^\d+]/g, "");
  if (!p) return "unknown";

  const digits = p.startsWith("+") ? p.slice(1) : p;

  // remove ES country code if present
  const es = digits.startsWith("34") ? digits.slice(2) : digits;

  if (es.startsWith("6") || es.startsWith("7")) return "mobile";
  if (es.startsWith("8") || es.startsWith("9")) return "landline";
  return "unknown";
}

function whatsappLikely(lead) {
  const cc = toStr(lead.countryCode).toUpperCase();
  if (cc !== "ES") return false;
  return lead.phone_type === "mobile";
}

return items.map((item) => {
  const r = item.json || {};

  const website = toStr(r.website);
  const domain = toStr(r.domain) || extractDomainFromUrl(website);

  const emails_all = uniq((r.emails || []).map(normEmail));
  const email_primary = pickPrimaryEmail(emails_all, domain);

  const phone_primary = pickPrimaryPhone(r.phone, r.phones || []);
  const phones_all = uniq([
    phone_primary,
    ...(r.phones || []).map(normalizePhone),
  ]).filter(Boolean);

  const categories = uniq((r.categories || []).map((c) => toStr(c)));
  const scrapedUrls = uniq((r.scrapedUrls || []).map((u) => toStr(u)));

  const ecommerce = detectEcommerce(scrapedUrls);

  const placeId = toStr(r.placeId);

  const phone_type = phoneTypeES(phone_primary);

  const dedupe_key_primary = placeId ? `place:${placeId}` : "";
  const dedupe_key_secondary =
    domain && toStr(r.city)
      ? `domcity:${domain}:${toStr(r.city).toLowerCase()}`
      : "";
  const dedupe_key_tertiary =
    toStr(r.title) && toStr(r.address)
      ? `nameaddr:${toStr(r.title).toLowerCase()}:${toStr(r.address).toLowerCase()}`
      : "";

  const lead_clean = {
    // core identity
    name: toStr(r.title),
    gmb_category: toStr(r.categoryName),
    categories,

    // contact
    website,
    domain,
    email_primary,
    emails_all,
    phone_primary,
    phones_all,
    phone_type, // mobile | landline | unknown
    whatsapp_likely: false, // set below

    // location
    address: toStr(r.address),
    street: toStr(r.street),
    neighborhood: toStr(r.neighborhood),
    city: toStr(r.city),
    postalCode: toStr(r.postalCode),
    state: toStr(r.state),
    countryCode: toStr(r.countryCode),

    // proof
    totalScore: Number(r.totalScore || 0),
    reviewsCount: Number(r.reviewsCount || 0),
    imagesCount: Number(r.imagesCount || 0),

    // status
    permanentlyClosed: !!r.permanentlyClosed,
    temporarilyClosed: !!r.temporarilyClosed,
    is_closed: !!r.permanentlyClosed || !!r.temporarilyClosed,

    // signals
    ecommerce,

    // traceability
    placeId,
    cid: toStr(r.cid),
    fid: toStr(r.fid),
    scrapedAt: toStr(r.scrapedAt),
    source: "google_maps_apify",
    scrapedUrls,

    // dedupe keys
    dedupe_key_primary,
    dedupe_key_secondary,
    dedupe_key_tertiary,
  };

  lead_clean.whatsapp_likely = whatsappLikely(lead_clean);

  const enrichment_needed = {
    missing_email: !lead_clean.email_primary,
    missing_website: !lead_clean.website,
    missing_domain: !lead_clean.domain,
    missing_contact_person: true,
  };

  return {
    json: {
      lead_clean,
      enrichment_needed,
    },
  };
});

/**
 * NODE 2 â€” Scoring/Prioritization (GENÃ‰RICO) + WhatsApp bonus + channel flags
 * openingHours ya no existe en lead_clean
 * n8n Code node
 * Mode: Run Once for All Items
 * Language: JavaScript
 */

function toStr(v) {
  return (v ?? "").toString().trim();
}

function scoreLead(lead) {
  if (lead.is_closed) return { score: 0, tier: "DROP", reasons: ["closed"] };

  let s = 0;
  const reasons = [];

  const hasEmail = !!toStr(lead.email_primary);
  const hasWebsite = !!toStr(lead.website);
  const hasPhone = !!toStr(lead.phone_primary);

  const reviews = Number(lead.reviewsCount || 0);
  const rating = Number(lead.totalScore || 0);

  // Contactability
  if (hasEmail) {
    s += 35;
    reasons.push("email:+35");
  }
  if (hasWebsite) {
    s += 15;
    reasons.push("website:+15");
  }
  if (hasPhone) {
    s += 5;
    reasons.push("phone:+5");
  }

  // Social proof
  if (reviews >= 500) {
    s += 20;
    reasons.push("reviews>=500:+20");
  } else if (reviews >= 100) {
    s += 15;
    reasons.push("reviews>=100:+15");
  } else if (reviews >= 20) {
    s += 8;
    reasons.push("reviews>=20:+8");
  } else if (reviews >= 1) {
    s += 3;
    reasons.push("reviews>=1:+3");
  }

  if (rating >= 4.8) {
    s += 10;
    reasons.push("rating>=4.8:+10");
  } else if (rating >= 4.5) {
    s += 7;
    reasons.push("rating>=4.5:+7");
  } else if (rating >= 4.0) {
    s += 4;
    reasons.push("rating>=4.0:+4");
  } else if (rating > 0) {
    s += 1;
    reasons.push("rating>0:+1");
  }

  // Ecommerce bonus (generic)
  if (lead.ecommerce && lead.ecommerce.is_ecommerce) {
    s += 8;
    reasons.push("ecommerce:+8");
  }

  // WhatsApp likelihood bonus (ES mobile)
  if (lead.whatsapp_likely) {
    s += 6;
    reasons.push("whatsapp_likely:+6");
  }

  if (s > 100) s = 100;

  const tier = s >= 75 ? "A" : s >= 55 ? "B" : "C";
  return { score: s, tier, reasons };
}

return items.map((item) => {
  const lead = item.json.lead_clean;

  const scoring = scoreLead(lead);

  const channel = {
    email: !!toStr(lead.email_primary),
    whatsapp: !!lead.whatsapp_likely,
    phone_call: !!toStr(lead.phone_primary),
    phone_type: toStr(lead.phone_type) || "unknown",
  };

  let route = "ENRICH";
  if (scoring.tier === "DROP") route = "DROP_CLOSED";
  else if (scoring.tier !== "C" && channel.email) route = "OUTREACH_READY";
  else route = "ENRICH";

  return {
    json: {
      ...item.json,
      score: scoring,
      routing: {
        route,
        priority_tier: scoring.tier,
      },
      channel,
    },
  };
});

function uniq(arr) {
  return Array.from(new Set((arr || []).filter(Boolean)));
}

function normEmail(e) {
  return (e || "").toString().trim().toLowerCase();
}

return items.flatMap((item) => {
  const lead_id = item.json.id;            // <- id de coeus.leads
  const lc = item.json.lead_clean || {};   // <- lead_clean jsonb

  const out = [];

  const emailPrimary = normEmail(lc.email_primary);
  const emailsAll = uniq((lc.emails_all || []).map(normEmail)).filter(Boolean);

  // Emails (primary primero)
  const emails = uniq([emailPrimary, ...emailsAll]).filter(Boolean);
  emails.forEach((email) => {
    out.push({
      json: {
        lead_id,
        type: "email",
        value: email,
        is_primary: emailPrimary && email === emailPrimary,
        priority: emailPrimary && email === emailPrimary ? 0 : 1,
        status: "new",
        meta: {
          source: lc.source || "google_maps_apify",
        },
      },
    });
  });

  const phonePrimary = (lc.phone_primary || "").toString().trim();
  const phonesAll = uniq((lc.phones_all || []).map((p) => (p || "").toString().trim())).filter(Boolean);

  // Phones
  const phones = uniq([phonePrimary, ...phonesAll]).filter(Boolean);
  phones.forEach((phone) => {
    out.push({
      json: {
        lead_id,
        type: "phone",
        value: phone,
        is_primary: phonePrimary && phone === phonePrimary,
        priority: phonePrimary && phone === phonePrimary ? 0 : 1,
        status: "new",
        meta: {
          source: lc.source || "google_maps_apify",
          phone_type: lc.phone_type || "unknown",
          whatsapp_likely: !!lc.whatsapp_likely,
        },
      },
    });
  });

  return out;
});
